import React, { useState } from "react";
import Welcome from "./props";

const InteractiveWelcome = () => {
const [name, setName] = useState("");

return (
    <div>
        <input
            type="text"
            value={name}
            onChange={e => setName(e.target.value)}
        />
        <Welcome name={name} />
    </div>
);
};

export default InteractiveWelcome;
